import React from 'react'
import S1 from '../assets/audios/S1.mp3'
import S2 from '../assets/audios/S1.mp3'
import S3 from '../assets/audios/S1.mp3'
import S4 from '../assets/audios/S1.mp3'

const ListeningSection = () =>{

    return(
        <>
        <div name="Question1">   
        <h2> SECTION 1          Questions 1 - 10</h2>
        <audio src={S1} controls>Play audio</audio>
        </div>
        </>
        
    )
}

export default ListeningSection;
